import{_ as i,c as a,o as t,a9 as e}from"./chunks/framework.CKUMok-g.js";const u=JSON.parse('{"title":"记一下 rustup 切换 rustc 版本不生效的问题","description":"","frontmatter":{"tags":"Rust","head":[["script",{},"!function(p){\\"use strict\\";!function(t){var s=window,e=document,i=p,c=\\"\\".concat(\\"https:\\"===e.location.protocol?\\"https://\\":\\"http://\\",\\"sdk.51.la/js-sdk-pro.min.js\\"),n=e.createElement(\\"script\\"),r=e.getElementsByTagName(\\"script\\")[0];n.type=\\"text/javascript\\",n.setAttribute(\\"charset\\",\\"UTF-8\\"),n.async=!0,n.src=c,n.id=\\"LA_COLLECT\\",i.d=n;var o=function(){s.LA.ids.push(i)};s.LA?s.LA.ids&&o():(s.LA=p,s.LA.ids=[],o()),r.parentNode.insertBefore(n,r)}()}({\\"id\\":\\"Jgmg5avjAUvoyePS\\",\\"ck\\":\\"Jgmg5avjAUvoyePS\\",\\"hashMode\\":true});"]]},"headers":[],"relativePath":"bigWeb/rust/rustup-rustc-change-fail.md","filePath":"bigWeb/rust/rustup-rustc-change-fail.md","lastUpdated":1769849351000}'),h={name:"bigWeb/rust/rustup-rustc-change-fail.md"};function r(l,s,n,p,d,k){return t(),a("div",{"data-pagefind-body":!0,"data-pagefind-meta":"date:1769849351000"},[...s[0]||(s[0]=[e(`<h1 id="记一下-rustup-切换-rustc-版本不生效的问题" tabindex="-1">记一下 rustup 切换 rustc 版本不生效的问题 <a class="header-anchor" href="#记一下-rustup-切换-rustc-版本不生效的问题" aria-label="Permalink to “记一下 rustup 切换 rustc 版本不生效的问题”">​</a></h1><p>省流：homebrew 和 rustup 安装 rustc 的冲突，卸载 homebrew 安装的 <code>rustc</code> 即可解决。</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">brew</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> uninstall</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> rust</span></span></code></pre></div><h2 id="问题描述" tabindex="-1">问题描述 <a class="header-anchor" href="#问题描述" aria-label="Permalink to “问题描述”">​</a></h2><p>准备尝鲜一下 <a href="https://tauri.app/" target="_blank" rel="noreferrer">tauri</a> 开发移动端应用，启动就卡在了第一步 <code>rustc</code> 版本不正确的问题。</p><p>按照官方文档安装 rustup 后，参照网上的经验 Rust: <a href="https://juejin.cn/post/7409958235279441970" target="_blank" rel="noreferrer">使用rustup管理rustc版本</a></p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">curl</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --proto</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &#39;=https&#39;</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --tlsv1.2</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> https://sh.rustup.rs</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -sSf</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> |</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> sh</span></span></code></pre></div><p>安装并设置稳定版</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">rustup</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> stable</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">rustup</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> default</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> stable</span></span></code></pre></div><p>奇怪的是 <code>rustup toolchain list</code> 已经是当下最新的 1.82.0</p><p>但运行 <code>rustc -V</code> 还是 1.64.0。</p><p>尝试卸载这个版本，也会提示这个版本不存在。</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">rustup</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> toolchain</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> uninstall</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> 1.64.0</span></span></code></pre></div><h2 id="解决" tabindex="-1">解决 <a class="header-anchor" href="#解决" aria-label="Permalink to “解决”">​</a></h2><p>折腾了一会儿我想是不是很久之前使用其它方式安装过 rustc 导致上述操作不符合预期。</p><p>我用<code>which</code> 查看了一下 rustc 的执行位置。</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">which</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> rustc</span></span></code></pre></div><p>发现其目录是 homebrew 安装的 rustc，并不是 rustup 安装的 rustc。</p><p>恍然大悟，应该是环境变量先后的问题，使用 brew 卸载之前的版本后 rustc 位置就正常了。</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">brew</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> uninstall</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> rust</span></span></code></pre></div><p><img src="https://cdn.upyun.sugarat.top/mdImg/sugar/c6ff1b4d27d9aabddd15cb9aae704528" alt="" loading="lazy"></p>`,21)])])}const o=i(h,[["render",r]]);export{u as __pageData,o as default};
